var title_f42_34_43559="Ventricular trigeminy tutorial";
var content_f42_34_43559=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F64181&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F64181&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1096px;\">",
"  <div class=\"figure\" style=\"width: 520px\">",
"   <div class=\"ttl\">",
"    Ventricular trigeminy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 500px; height: 111px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Every third beat is a ventricular premature beat. The coupling interval between the ventricular premature beat and the previous sinus QRS complex is constant (fixed coupling interval).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 456px\">",
"   <div class=\"ttl\">",
"    Sinus rhythm",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 456px; height: 103px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The normal P wave in sinus rhythm is slightly notched since activation of the right atrium precedes that of the left atrium. The P wave is upright in a positive direction in leads I and II. A P wave with a uniform morphology precedes each QRS complex. The rate is between 60 and 100 beats per minute and the cycle length is uniform between sequential P waves and QRS complexes. In addition, the P wave morphology and PR intervals are identical from beat to beat.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
