var title_f42_34_43563="Renal dosing of antituberculous agents";
var content_f42_34_43563=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F63357&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F63357&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Dosing recommendations for adult patients with reduced renal function",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Drug",
"      </td>",
"      <td class=\"subtitle1\">",
"       Change in frequency?",
"      </td>",
"      <td class=\"subtitle1\">",
"       Recommended dose and frequency for patients with CrCl &lt;30 ml/min or for patients receiving intermittent hemodialysis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Isoniazid",
"      </td>",
"      <td>",
"       No change",
"      </td>",
"      <td>",
"       300 mg PO once daily, or 900 mg PO three times per week",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Rifampin",
"      </td>",
"      <td>",
"       No change",
"      </td>",
"      <td>",
"       600 mg PO once daily, or 600 mg PO three times per week",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Pyrazinamide",
"      </td>",
"      <td>",
"       Yes",
"      </td>",
"      <td>",
"       25-35 mg/kg (IBW) per dose PO three times per week (NOT daily); max 2.5 g per dose.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Ethambutol",
"      </td>",
"      <td>",
"       Yes",
"      </td>",
"      <td>",
"       15-25 mg/kg (IBW) per dose PO three times per week (NOT daily); max 1.6 g per dose",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    CrCl: Creatinine clearance by Cockcroft-Gault equation (See \"Calculator: Creatinine clearance estimate by Cockcroft-Gault equation)",
"    <br>",
"     PO: by mouth",
"     <br>",
"      IBW: ideal body weight",
"      <br>",
"       Standard doses are given unless there is intolerance.",
"       <br>",
"        On the day of hemodialysis medications should be administered after hemodialysis",
"        <br>",
"         Monitoring of serum drug concentrations should be considered to ensure adequate drug absorption without excessive accumulation and to assist in avoiding toxicity.",
"         <div class=\"footnotes\">",
"         </div>",
"         <div class=\"reference\">",
"          Reproduced with permission from: Blumberg, HM, Burman, WJ, Chaisson, RE, et al. American Thoracic Society/Centers for Disease Control and Prevention/Infectious Diseases Society of America: treatment of tuberculosis. Am J Respir Crit Care Med 2003; 167:603. Official Journal of the American Thoracic Society. Copyright &copy;2003 American Thoracic Society.",
"         </div>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
